import { Box, FilledInput, FormControl, Grid, Input, InputAdornment, Stack, Typography } from '@mui/material';
import Selected from '../../../selected/Selected';

function SalaryNWageForm() {
  return (
    <Box>
      <Stack
        component="form"
        direction="column"
        spacing={2}
        sx={{
          paddingLeft: '20px',
          paddingRight: '20px',
          paddingBottom: '20px',
          gap: '10px',
          display: 'flex',
          maxWidth: '560px',
          width: '100%',
        }}
      >
        <Grid
          container
          spacing={'row'}
          sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
        >
          <Grid
            item
            xs={4}
            sx={{
              paddingLeft: '0 !important',
              paddingTop: '0 !important',
              display: 'flex',
              alignItems: 'center',
              marginTop: '0 !important',
            }}
          >
            <Typography
              variant="body2"
              gutterBottom
              sx={{
                fontFamily: 'SVN-Sofia-Regular',
                display: 'flex',
                alignItems: 'center',
                margin: 0,
                fontSize: '16px',
              }}
            >
              Basic Salary
              <Box component="span" sx={{ color: 'rgb(229, 72, 77)', margin: 0 }}>
                *
              </Box>
            </Typography>
          </Grid>
          <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}>
            <FormControl>
              <Input
                id="my-input"
                aria-describedby="my-helper-text"
                type="number"
                startAdornment={
                  <InputAdornment position="start">
                    <Typography component="p" sx={{ fontFamily: 'SVN-Sofia-Regular', color: 'rgb(0, 106, 220)' }}>
                      Rp
                    </Typography>
                  </InputAdornment>
                }
                sx={{
                  '&:before': { content: 'none' },
                  padding: '8px',
                  backgroundColor: 'rgb(241, 243, 245)',
                  borderRadius: '6px',
                  width: '100%',
                }}
              />
            </FormControl>
          </Grid>
        </Grid>
        <Grid
          container
          spacing={'row'}
          sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
        >
          <Grid
            item
            xs={4}
            sx={{
              paddingLeft: '0 !important',
              paddingTop: '0 !important',
              display: 'flex',
              alignItems: 'center',
              marginTop: '0 !important',
            }}
          >
            <Typography
              variant="body2"
              gutterBottom
              sx={{
                fontFamily: 'SVN-Sofia-Regular',
                display: 'flex',
                alignItems: 'center',
                margin: 0,
                fontSize: '16px',
              }}
            >
              Employee Type
            </Typography>
          </Grid>
          <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}>
            <Selected defaultOption="Choose Position" objectOption={['N/A', 'Junior', 'Vice Manager', 'Manager']} />
          </Grid>
        </Grid>
      </Stack>
    </Box>
  );
}

export default SalaryNWageForm;
